import React from 'react';

const Footer = () => {
    return (
        <div className="myfooter pt-1 pb-0 mb-0">
            <footer className="align-middle">
                <p className='text-center align-middle'>Footer</p>
            </footer>
        </div>
    );
};

export default Footer;
